import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css'
import logo from '../../img/logo.png'


export function NavBar() {
    return (
        <nav >
        <img src={logo} alt='...' />
        <ul>
        <Link href='/'> <li><a className='dropbtn'> iWorld! </a> </li> </Link>
        <Link href='/home'> <li><a className='dropbtn'> Home </a></li> </Link>
        <Link href='/Activities'>
          <li className="dropdown"> 
           <a  className='dropbtn'>Actividades </a>
           <div className="dropdown-content">
             <Link href='/addactivity'><a> Agregar Actividades </a></Link>
             <Link href='/listactivity'><a> Ver Actividades por Pais </a></Link>
           </div>
          </li>
        </Link>
        <Link to='/about'> <li><a href='' className='dropbtn'> Sobre el Proyecto </a> </li> </Link>
        </ul>
    </nav>
    )
};

export default NavBar;
